INSERT INTO quest_template(entry, Method, ZoneOrSort, MinLevel, QuestLevel, Type, SuggestedPlayers, QuestFlags, SpecialFlags, PrevQuestId, Title, Details, Objectives, OfferRewardText, ReqCreatureOrGOId1, ReqCreatureOrGOCount1, RewOrReqMoney, RewMoneyMaxLevel)  VALUES(800000, 2, 66, 75, 77, 1, 5, 130, 0, 12933, "The Amphitheater of Anguish: From Beyond!!", "I'm not gonna lie to you, pal. You might be overmatched here. This next one is a being from the elemental planes! I don't even know what's gonna show up in that arena!$B$BIf you think you're up to it, get in there and give 'em hell!", "Get in the arena at the Amphitheater of Anguish and defeat one of the elemental lords! Return to Wodin the Troll-Servant to redeem your reward.", "Unbelievable! I thought this whole place was going to explode when it first appeared! You really dominated that round!", 30026, 1, 195000, 192600);

