INSERT INTO quest_template(entry, Method, ZoneOrSort, MinLevel, QuestLevel, Type, SuggestedPlayers, QuestFlags, SpecialFlags, PrevQuestId, Title, Details, Objectives, OfferRewardText, ReqCreatureOrGOId1, ReqCreatureOrGOCount1, RewChoiceItemId1, RewChoiceItemId2, RewChoiceItemId3, RewChoiceItemId4, RewChoiceItemId5, RewChoiceItemId6, RewChoiceItemCount1, RewChoiceItemCount2, RewChoiceItemCount3, RewChoiceItemCount4, RewChoiceItemCount5, RewChoiceItemCount6, RewOrReqMoney, RewMoneyMaxLevel) VALUES(800001, 2, 66, 75, 78, 1, 5, 130 , 0, 12936, "The Champion of Anguish!", "This is the end, my friend! Your last opponent is going to be your greatest challenge. He's a vrykul champion from the steppes of Icecrown and he's out for blood! Defeat him and you'll be crowned the champion of the Amphitheater of Anguish! This fight is going to make us both rich!$B$BLet me know when you're ready and we'll start.", "Get in the arena at the Amphitheater of Anguish and defeat Vladof the Butcher! Return to Wodin the Troll-Servant to redeem your reward.", "You did it, $n! That was the most exciting fight yet! What are you going to do with your winnings? Me? I'm going to Dalaran and blowing it all in the Underbelly. Lot of hot action going on down there!", 30022, 1, 41815, 41821, 41825, 41816, 41822, 41824, 1, 1, 1, 1, 1, 1, 204000, 194400);

